window.jsPDF = window.jspdf.jsPDF;

var font = '';
var callAddFont = function () {
this.addFileToVFS('Da Vinci Font-normal.ttf', font);
this.addFont('Da Vinci Font-normal.ttf', 'Da Vinci Font', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])


const button = document.getElementById('button');
const textArea = document.getElementById('textArea');

button.addEventListener('click', () => {
    let text = textArea.value;

    if (text != ""){
        let pdf = new jsPDF();
        pdf.setFont('Da Vinci Font', 'normal');
        pdf.text(text, 10, 10, {maxWidth: 190, align: 'justify'});
        pdf.save("download.pdf");
    } else {
        alert("Please write on the box!");
    }
});